_.ready(function(){
    /**/
    var i=0;
    var dieCount=0;
    /*初始化2d游戏引擎*/
    _.engine.initCanvas("canvas_box",320,320);
    /*新建一个场景*/
    var screen=_.engine.create_screen();

    /*新建一个时间文本
     var time_text=_.engine.create_text("time",100,100);
     time_text.setText(0);
     time_text.setSize(50);
     time_text.setColor("#f00");
     time_text.setUpdate(function(){
     this.setText(this.getText()+1);
     })
     */
    /*向场景添加时间文本*/
    //screen.add(time_text);



    var ok_text=_.engine.create_text("life",220,20);
    ok_text.setColor("#f00");
    ok_text.setSize(20);
    ok_text.setText("ok:"+dieCount);
    screen.add(ok_text);

    /*新建一个玩家精灵*/
    var player=_.engine.create_sprite("player",50,50,50,50,"data:image/png;base64,");
    player.setLife(3);//设置生命值
    player.setUpdate(function(){
        if(this.toY<this.y){
            this.y--;
        }else{
            this.y++;
            this.toY=this.y;
        }
        if(this.y> _.canvas_h-this.h/2){

            this.y= _.canvas_h-this.h/2;
        }
        /*
         _.c.fillStyle = "#F00";
         _.c.beginPath();
         _.c.arc(this.x, this.y, 15, 0, Math.PI * 2, 1);
         _.c.closePath();
         _.c.fill();
         */
    }).setDie(function(){
        this.y=50;
    }).setType("player");
    /*添加玩家精灵到场景*/
    player.toY=300;
    screen.add(player);

    var life_text=_.engine.create_text("life",10,20);
    life_text.setColor("#f00");
    life_text.setSize(20);
    life_text.setText("life:"+player.life);
    screen.add(life_text);

    /* 设置游戏逻辑 */
    _.engine.setGameLoop(function(){
        //game code here
        /* 显示玩家精灵生命值 */
        life_text.setText("life:"+player.life);
        /*添加敌人精灵到场景*/
        if(_.timer>=100){
            _.timer=0;
            screen.add(_.engine.create_sprite("blue",320,Math.floor(Math.random()* _.canvas_h),48,48,"data:image/png;base64,").setUpdate(function(){
                this.x--;
                //this.y++;
                if(this.y>= _.canvas_h){
                    this.life=0;
                    //_.log("die")
                }
            }).setDie(function(){
                dieCount++;
                ok_text.setText("ok:"+dieCount);
            }));
        }
        /* 添加生命值精灵 */
        if(_.life_timer>=1000){
            _.life_timer=0;
            /*添加星星到场景*/
            screen.add(_.engine.create_sprite("heart",Math.floor(Math.random()* _.canvas_w),50,48,48,"data:image/png;base64,").setUpdate(function(){
                //this.x++;
                this.y++;
                if(this.y>= _.canvas_h){
                    this.life=0;
                    //_.log("die")
                }
            }).setType("life").setDie(function(){

            }));
        }
    })
    /*新建一个渲染器*/
    var render= _.engine.create_render();
    /*渲染场景，以1000/16秒一帧的速度。*/
    render.render(screen,5);
    document.onkeydown = function (e) {
        k = e.which;
        if ((k == 39) && (player.x < 300)) {
            player.x += 5;
        }
        if ((k == 37) && (20 < player.x)) {
            player.x -= 5;
        }
    }
    _("#canvas_box").click(function(){
        player.toY=player.y-50;
    });
});
